import './Estante.css'

function Estante(props){
  
return(
  <div className='Estante' style={{left: props.x, top: props.y, rotate: props.r+"deg", height: props.h, width: props.w, backgroundColor: props.c}}>
  </div>  
)
}
export default Estante
